function convert_erc20_arr(input) {
    return input.map(obj => {
        const symbol = Object.keys(obj)[0],
            data = obj[symbol];
        return {
            "name": data.name,
            "symbol": symbol,
            "cmcid": data.cmcid,
            "contract": data.main
        };
    });
}